import React from "react";
import { Link } from 'react-router-dom';

const Avances = () => {
  return (
    <div className="self-start">
      <Link to="/proyectos/:_id">
        <i className="fas fa-arrow-left" />
      </Link>
    </div>
  );
};

export default Avances;
